import logo from './logo.svg';
//import './App.css';
import React, {useEffect, useState} from 'react';
import {getmovie, getpopular} from './Api/api';
import Search from './Components/Search';
import {MyProfile, MyList} from "./Components/Myprofile";
import Home from './Components/Homepage';
import { MovieDetail } from './Components/Movieinfo';
import MovieList from './Api/Movie';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";




export default function App() {



   return (

        <Router>
         <div>
           <Routes>
             <Route path="/" element={<Home/>}/>
             <Route path="/MyProfile" element={<MyProfile />} />
             <Route path="/Search" element={<Search />} />

             <Route path="/mylist" element={<MyList />} />
             <Route path="/movieinfo/:id" element={<MovieList/>}/>


           </Routes>
         </div>
       </Router>


   );




}



